import React from "react";

const JobEmployers = () => {
  const employers = [
    { logo: "path/to/unique-saints-logo.png", company: "Unique Saints Design" },
    { logo: "path/to/blinkstar-logo.png", company: "BlinkStar Designs" },
    { logo: "path/to/kilar-novels-logo.png", company: "Kilar Novels" },
  ];

  return (
    <div className="jobemplyers">
      <div className="headpara">
        <div className="employers-sect">
          {employers.map((employer, index) => (
            <div key={index} className="employer-card">
              <img src={employer.logo} alt={`${employer.company} Logo`} />
              <h3>{employer.company}</h3>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default JobEmployers;
